import { useHistory } from "react-router";
import "./SensorItem.css";
import { Card, CardTitle, CardText, Button} from 'reactstrap'

const SensorItem = ({ sensor }) => {
  const history = useHistory();
  const { _id, name, maxval, minval, address, active } = sensor
  const { coordinates } = sensor.location
  
  return (
    <div row>
      <div col-md-3>
    <Card body outline color="warning" onClick={() => history.push(`/update/${_id}`)}>
        <CardTitle tag="h5">{name}</CardTitle>
        <span className="text-danger">X</span>
        <CardText><p>{address}</p>
         <p>Coordenadas: {coordinates}</p>
         <p>{active}</p>
         <p>MinVal: {minval}</p>
         <p>MaxVal: {maxval}</p></CardText>
        <Button color="primary">Button</Button>
      </Card>

      </div>
